import classes from "./Customer.module.css";

const Customer = (props) => {
  return (
    <li className={classes.item}>
      <div>{props.name}</div>
      <div>{props.address}</div>
      <div>{props.vat}</div>
      <div>{props.date}</div>
    </li>
  );
};

export default Customer;
